function addLinkTarget(){document.querySelectorAll(".fh5co-blog").forEach(n=>{n.querySelectorAll("a").forEach(n=>{n.setAttribute("target","_blank")})})}function moveToDC(){var n=document.scrollingElement.scrollTop;n+=10;document.scrollingElement.scrollTop=n;timer=setTimeout(moveToDC,.1);document.scrollingElement.scrollTop>810&&clearTimeout(timer)}function playMusic(){var n=document.getElementById("player");try{n.addEventListener("ended",()=>{setTimeout(()=>{n.src=musicSrc+"?"+Math.random(),n.play()},1e3)});n.play()}catch(t){}}function init(){musicSrc=document.getElementById("player").src;playMusic();addLinkTarget()}var musicSrc=undefined;init();